import React, { useEffect, useState } from 'react'
import cocktailService from './services/cocktailData'

function App() {

  const baseURL = 'www.thecocktaildb.com/api/json/v1/1/search.php?s=margarita'

  const [cocktail, setCocktail] = useState('')

  useEffect(() => {
    cocktailService 
      .getData(baseURL)
      .then(res => {
        console.log(res.drinks[0].strDrink)
        setCocktail(res.drinks[0].strDrink)
      })
  }, [cocktail])

  return (
    <div>
      <p>hi</p>
      <p>{cocktail}</p>
    </div>
  );
}

export default App;
